INSERT INTO `ru_news` VALUES (1,'U.S. Presses Partners to Weed Out Illicit Trade With Russia','/2023/02/04/world/middleeast/us-turkey-uae-russia-sanctions.html','Ben Hubbard','Feb.4, 2023','American officials worry that commercial activities in Turkey and the United Arab Emirates could be fueling Russia鈥檚 war machine and have threatened to punish those involved.','U.S. Presses Partners to Weed Out Illicit Trade With Russia',2649,2.6),(2,'Russia Pushes to Take Ukrainian Town Near a Vital Supply Line','/2023/02/04/world/europe/ukraine-russia-war-vuhledar.html','Marc Santora','Feb.4, 2023','Ukraine has used the strategic town of Vuhledar to launch attacks disrupting transit on a critical rail link between the war鈥檚 southern and eastern fronts.','Russia Pushes to Take Ukrainian Town Near a Vital Supply Line',7,7.5),(3,'U.S. Sends Longer-Range Weapons','/2023/02/03/briefing/russia-ukraine-war-weapons.html','Carole Landry','Feb.3, 2023','The latest aid package will allow Ukraine to hit targets 90 miles away.','U.S. Sends Longer-Range Weapons',23,5.4),(4,'What Weapons Is Ukraine Getting, and Will They Arrive in Time?','/article/ukraine-weapons-jets-tanks.html','Lara Jakes','Feb.3, 2023','Kyiv has been promised scores of tanks and other armor, and the longest range munitions yet. But with a looming Russian offensive, a race is on to get the mat茅riel to the battlefield.','What Weapons Is Ukraine Getting, and Will They Arrive in Time',668,8.9),(6,'Your Friday Briefing: The U.S. Military Expands in the Philippines','/2023/02/02/briefing/us-philippines-military-china-asia.html','Amelia Nierenberg','Feb.2, 2023','Also, Vladimir Putin evokes Stalingrad and a contested film is a box-office hit in India.','Your Friday Briefing The U.S. Military Expands in the Philippines',25,9.9),(7,'Deadly Russian Attack Destroys Kramatorsk Apartment','/video/world/europe/100000008752417/ukraine-kramatorsk-strike.html','Reuters','Feb.2, 2023','Rescue crews helped injured and trapped civilians in the industrial Ukrainian city of Kramatorsk, which has been the site of frequent attacks since Russia鈥檚 invasion.','Deadly Russian Attack Destroys Kramatorsk Apartment',43,1.2),(8,'Has the Russian Offensive Begun?','/2023/02/01/briefing/russia-ukraine-war-trade.html','Carole Landry','Feb.1, 2023','Ukraine is bracing for a major escalation in the Donbas.','Has the Russian Offensive Begun',4,1.4),(9,'Your Thursday Briefing: Rising Militancy in Pakistan','/2023/02/01/briefing/pakistan-peshawar-bombing-adani-asia.html','Amelia Nierenberg','Feb.1, 2023','Also, Adani Enterprises pulls its offering and soldiers die on both sides in Bakhmut.','Your Thursday Briefing Rising Militancy in Pakistan',38,0.6),(10,'Your Wednesday Briefing: China Rebounds','/2023/01/31/briefing/china-covid-economy-asia.html','Amelia Nierenberg ','Jan.31, 2023','Also, Russia resilient economy and Sri Lanka enduring struggle.','Your Wednesday Briefing China Rebounds',1927,5.2);
