INSERT INTO `time_info` VALUES ('2022-02-24','The Russian-Ukrainian conflict officially breaks out. On the same day, Ukraine announces the closure of the national airspace and the severance of diplomatic relations with Russia, and President Zelensky states that Ukraine is in a state of war. On the same day, Russian troops shelled troops in eastern Ukraine, military command centres in other regions and airports.','https://baijiahao.baidu.com/s?id=1725653634185725245&wfr=spider&for=pc'),('2022-03-07','Russia offers 3 conditions for ceasefire to Ukraine.','https://baijiahao.baidu.com/s?id=1726644297694878658&wfr=spider&for=pc'),('2022-03-10','Russia-Ukraine foreign minister talks, no ceasefire deal.','https://baijiahao.baidu.com/s?id=1726910232807169208&wfr=spider&for=pc'),('2022-03-23','Russia and Ukraine have agreed to open nine humanitarian corridors to evacuate civilians.','https://baijiahao.baidu.com/s?id=1728091695446326369'),('2022-03-29','Five rounds of peace talks between Russia and Ukraine.','https://baike.baidu.com/item/%E4%BF%84%E4%B9%8C%E5%92%8C%E5%B9%B3%E8%B0%88%E5%88%A4/60184082?fr=aladdin'),('2022-04-08','Russia\'s seat on the UN Human Rights Council suspended.','https://baijiahao.baidu.com/s?id=1729490873338379691&wfr=spider&for=pc'),('2022-04-19','Zelensky: Russian troops begin offensive in Donbass.','https://baijiahao.baidu.com/s?id=1730492780367801362&wfr=spider&for=pc'),('2022-04-20','Ukrainian side confirms Russian occupation of Crimea.','https://baijiahao.baidu.com/s?id=1730595189072426641&wfr=spider&for=pc'),('2022-04-21','Putin: Battle operation to liberate Mariupol a success.','https://baijiahao.baidu.com/s?id=1730704848313853826&wfr=spider&for=pc'),('2022-05-05','Russian troops have stormed Azov steel plant.','https://baijiahao.baidu.com/s?id=1731940049818179683'),('2022-05-16','NATO pledges unrestricted military support to Ukraine.','https://baijiahao.baidu.com/s?id=1732968527895039415&wfr=spider&for=pc'),('2022-05-17','Ukrainian side hands over control of Mariupol to Russian side.','https://3w.huanqiu.com/a/a4d1ef/482l1fMbxFC'),('2022-05-21','Russia announces it has taken full control of the Azov steel plant in Mariupol.','https://baijiahao.baidu.com/s?id=1733390522391952384&wfr=spider&for=pc'),('2022-05-31','Russian troops storm North Donetsk city centre.','https://baijiahao.baidu.com/s?id=1734295296982801470'),('2022-06-02','Zelensky: Russia already controls one-fifth of Ukraine\'s territory.','https://baijiahao.baidu.com/s?id=1734524902503753619&wfr=spider&for=pc'),('2022-06-09','Zelenski signs presidential decree sanctioning Putin.','https://baijiahao.baidu.com/s?id=1735170691786689261&wfr=spider&for=pc'),('2022-06-26','Russian Defence Ministry: Russian troops and Lugansk forces are in full control of North Donetsk.','https://baijiahao.baidu.com/s?id=1736639524353703262'),('2022-06-30','Russian Defence Ministry: Russian troops withdrawn from Snake Island as a gesture of goodwill.','https://baijiahao.baidu.com/s?id=1737049124666458273&wfr=spider&for=pc'),('2022-07-03','Explosion in Russian city of Belgorod, Russian response: Ukrainian aggression.','https://baijiahao.baidu.com/s?id=1737310446904938764&wfr=spider&for=pc'),('2022-07-04','Russian defence minister says Russian troops are in full control of Lissichansk Ukrainian side says Ukrainian troops have withdrawn.','https://baijiahao.baidu.com/s?id=1737374482861022916&wfr=spider&for=pc'),('2022-07-12','Zelenski orders a million troops to counter-attack.','https://haokan.baidu.com/v?pd=wisenatural&vid=8797828313457455395'),('2022-08-03','Russia accuses US of direct involvement in Russia-Ukraine war for the first time','https://baijiahao.baidu.com/s?id=1740120083878938648&wfr=spider&for=pc'),('2022-08-09','Pentagon official: Russian military casualties exceed 70,000.','https://baijiahao.baidu.com/s?id=1740655134450686248'),('2022-08-10','500 Russian troops use Zaporozhye nuclear power plant as cover for shelling U.S. Army positions: U.S. official.','https://baijiahao.baidu.com/s?id=1740737221581284551&wfr=spider&for=pc'),('2022-08-12','UN meeting on Zaporozhye nuclear power plant attack.','https://baijiahao.baidu.com/s?id=1740906648620307584&wfr=spider&for=pc'),('2022-08-24','Rare public disclosure of casualty figures: about 9,000 UPDF officers and soldiers killed in action.','https://baijiahao.baidu.com/s?id=1742041968694301575'),('2022-08-30','Russian media: Zaporozhye nuclear power plant shelled again by U.S. forces, radiation situation now normal.','https://baijiahao.baidu.com/s?id=1742552517195777369&wfr=spider&for=pc'),('2022-09-05','Fierce fighting breaks out between Russia and Ukraine over nuclear power plant.','https://baijiahao.baidu.com/s?id=1743081125962484545'),('2022-09-12','Ukrainian side: Ukrainian troops have broken through to the Ukrainian-Russian border area.','https://baijiahao.baidu.com/s?id=1743762981703932640'),('2022-09-21','Putin announces partial mobilisation in national address: goal to \"liberate Donbass\".','https://baijiahao.baidu.com/s?id=1744559052724937458'),('2022-09-24','Russian President Vladimir Putin signs a series of laws related to partial mobilisation.','https://baijiahao.baidu.com/s?id=1744857109240486244'),('2022-09-28','Donetsk and four other places join Russia referendum results announced.','https://baijiahao.baidu.com/s?id=1745162968447162637'),('2022-09-30','Ukraine signs application to join NATO.','https://baijiahao.baidu.com/s?id=1745406086128875407'),('2022-10-01','Russian troops and Donbass forces have withdrawn from Red Liman.','https://baijiahao.baidu.com/s?id=1745494782658832058'),('2022-10-02','Russia\'s Constitutional Court finds that the treaty on the accession of Donetsk and four other territories to Russia is in line with the Russian Constitution.','https://baijiahao.baidu.com/s?id=1745570990272194618'),('2022-10-05','Treaty on the accession of four regions, including Donetsk, to Russia enters into force.','https://baijiahao.baidu.com/s?id=1745829107717130350&wfr=spider&for=pc'),('2022-10-08','Crimean bridge catches fire, part of it collapses.','https://haokan.baidu.com/v?pd=wisenatural&vid=2659394902050188935'),('2022-10-11','Ukraine\'s State Emergency Service: 19 dead, 105 injured in air strikes.','https://baijiahao.baidu.com/s?id=1746369552445187250'),('2022-10-19','Zelenski: No room for negotiation with Russia in attack on power station.','https://haokan.baidu.com/v?pd=wisenatural&vid=2758648461949282701'),('2022-10-25','Russia says it does not intend to use nuclear weapons in Ukraine','https://baijiahao.baidu.com/s?id=1747633123960154287&wfr=spider&for=pc'),('2022-11-02','Pentagon admits US military personnel already in Ukraine: monitoring where weapons aid is going','https://baijiahao.baidu.com/s?id=1748384571684034648&wfr=spider&for=pc'),('2022-11-09','Ukraine sets out preconditions for peace talks with Russia: Russia returns all Ukrainian territories under its control.','https://baijiahao.baidu.com/s?id=1748993742116970537&wfr=spider&for=pc'),('2022-11-12','Zelensky: \"Historic day\" as UPDF enters Kherson on 11.','https://baijiahao.baidu.com/s?id=1749260876143064947'),('2022-11-14','Russia and Ukraine at war in Donetsk and Luhansk regions.','https://baijiahao.baidu.com/s?id=1749423920870865080&wfr=spider&for=pc'),('2022-11-24','Russian defence ministry: evidence of US attempt to use biological weapons in Ukraine available.','https://baijiahao.baidu.com/s?id=1750377201565715393&wfr=spider&for=pc'),('2022-12-02','Kremlin: Putin open to talks on Ukraine.','https://baijiahao.baidu.com/s?id=1751108268982488473&wfr=spider&for=pc'),('2022-12-14','Zelensky proposes \'three steps to peace\' in Ukraine Russian response: Kiev must consider current realities.','https://baijiahao.baidu.com/s?id=1752143874496333695&wfr=spider&for=pc'),('2022-12-17','Russia launches \'largest\' missile strike on Ukraine','https://baijiahao.baidu.com/s?id=1752421594761209388'),('2022-12-23','US Senate passes FY2023 spending bill, will provide $45 billion in aid to Ukraine.','https://baijiahao.baidu.com/s?id=1752977124935302889'),('2022-12-31','Zelenski signs bill to restrict media, bans positive coverage of Russia.','https://baijiahao.baidu.com/s?id=1753694873767761553&wfr=spider&for=pc'),('2023-01-01','Air-raid sirens sounded throughout Ukraine as many parts of Donetsk are attacked.','https://baijiahao.baidu.com/s?id=1753815578474046018');
