INSERT INTO `weapons` VALUES (' MP-448 Skyph',2,'The MP-448 Skyph is the latest improvement of the Makarov pistol, developed by the Izhevsk Mechanical Plant (IzhMech, or Baikal) in the late 1990s. The gun has an engineered plastic base and a cast steel firing mechanism with an improved and more reliable safety mechanism. The use of engineering plastics makes the Skyph a lighter pistol than the Maglov, and its shape is more ergonomic. This model is primarily intended for export and is available in two calibres.',5),('AK-47 / AKS-47',2,'The AK-47 has mechanical sights with night vision sights. The column collimator and the U-notch illuminated door of the table ruler have reversible attachments and are fitted with fluorescent material radium 221. the table ruler is divided into 100 to 800m, one division is 100m and the combat table ruler is fitted with 300m. but when aiming with the sight, the collimator can only be twisted up and down for height correction, no wind deflection correction is possible.',1),('DShK/DShKM large calibre machine gun',2,'The DShK gradually replaced many 7.62mm Maxim heavy machine guns during the war and performed well in the war. The armour-piercing rounds fired from the DShK could penetrate 15mm thick steel plates at a range of 500m, making it an excellent weapon for supporting infantry in ground combat as it was effective not only against low-flying enemy aircraft but also against lightly armoured targets or infantry bunkers.',2),('Elf-2 submachine gun',1,'The Elf-2 submachine gun is similar in design to the Uzi or Steyr MPi-69, including a magazine inserted into the grip and an enveloping mechanism that opens for firing. The mechanism, however, consists of two articulated parts that have the effect of delaying recoil to reduce the rate of fire, maintaining a theoretical rate of fire of approximately 450 rounds per minute, and the system also claims to have the benefit of reduced recoil and shooting vibration.',4),('Evgeniy Fedorovich Dragunov Sniper Rifles',2,'The first prototype of the Dragunov sniper rifle (for convenience, the SVD-1958) differed from the model later finalised in 1963 in both the stock and the wood guard. The SVD-1958 also has a sight door positioned above the rear of the receiver, a sight design taken directly from the AK-47, and no flameproofing at the muzzle. The gun is very accurate, but not reliable, and needs a lot of improvement.',3),('Goblin folding submachine gun',1,'The Goblin submachine gun is a Ukrainian copy of the former Soviet PP-90 folding submachine gun since the collapse of the Soviet Union. Like the PP-90, the Goblin submachine gun has a folding mechanical sight, making it easier to aim than the American Ares FMG. In addition, unlike the PP-90, the Goblin submachine gun has an additional short foregrip to make gripping it easier. There were also two calibres, the 9 x 18mm Makarov and the 9 x 19mm Parabellum.',4),('GP-30 Gun Mounted Grenade Launcher',2,'The GP-30 is an improvement on the GP-25, with a slight weight reduction and some shortening of the overall length, but the barrel length remains unchanged and the tactical performance is identical. The existing GP-25 is still in use by the Russian Army, so the manufacturer is mainly targeting foreign trade. The GP-30 is also fitted with the VOG-25 series of anti-personnel grenades.',7),('GSh-18',2,'The GSh-18 (Russian ГШ-18) pistol was developed by the Russian KBP (Instrument Design Bureau, КБП). The main designers were Gryazev (Грязева Василия Петровича, Latinized Gryazev Vasily Petrovich) and Shipunova (Шипунова Аркадия Георгиевича, Latinized Shipunova Arcadia Georgievicha), who collaborated on the development of the aerial gun GSh-23 and GSh-301, among others. The \"23\" in GSh-23 indicates the calibre, while the \"18\" in GSh-18 indicates the magazine capacity.',5),('KEDR/KLIN',2,'As the 9 x 18mm PM pistol cartridge was not powerful enough, it did not take long to develop a new 9 x 18mm PMM pistol cartridge (see the Makarov pistol article for details). In 1994, the Izhevsk Arsenal enhanced the KEDR to fire a high-capacity cartridge and named it the PP-9 KLIN (KLIN in Russian), which was produced between 1996 and 2002 and equipped in small numbers by some Russian police and security forces. A shorter full-length KLIN-2 version was later said to be in development.',4),('Kord-5.45',2,'The Kord-5.45 (КОРД-5.45) light machine gun is a 5.45mm calibre dual mode light machine gun similar to the FN Minimi, which was originally developed from a requirement for a \"5.45mm assault machine gun\" issued by the Russian Ministry of the Interior (MVD) in 2011 to provide counter-terrorism The aim was to provide special police units with a light machine gun that would have a longer-lasting firepower than the current 5.45mm squad light machine gun, known as the RPK74 series. The development project is codenamed \"Tokar\" (pronounced \"Tokar\"), which is Cyrillic for \"Токарь\", meaning \"lathe worker \". The initial requirements included a chain fed cartridge, two rates of fire (600RPM and 900RPM were explicitly requested) and a quick barrel change, while the maximum empty weight could not exceed 6.5kg, although a dual feed mode was not yet required.',2),('Mosin-Nagant',2,'The M1891 cartridge was a 210-grain, copper-nickel armored, lead-core, blunt round-tipped cartridge. Copper-nickel alloy is armoured, lead core of the blunt round head-shaped cartridge, in Germany adopted the tip of the bullet, Russia also began to develop the tip of the bullet.',1),('MSMC',0,'The MSMC submachine gun fires the 5.56×30mm cartridge, which has better penetration than the 9×19mm. The calibre is said to be made from a shortened case of 5.56×45 NATO ammunition, which is 42mm long, weighs 6g overall, has a 17mm long bullet with a 2.6 gram tip, and has a muzzle velocity of 650m/s fired from a 300mm barrel. It uses the guided automatic principle, with the ability to select semi-automatic or fully automatic firing modes, a large grip guard (the early prototypes had a small traditional trigger guard), a pull handle and safety/quick release handle that can be operated with either the right or left hand, a telescopic stock to reduce the overall size of the gun, a Picatinny rail on top of the receiver for mounting accessories, and the published prototype fitted with the ITL fitted to the Israeli TAR-21. MARS laser pointer/red dot sight fitted to the Israeli TAR-21. A muzzle flamer is fitted and a silencer can be added, as well as a bayonet.',4),('PP-19 Bizon',2,'The BIZON-2 has a Kalasnikov rear sight with a sliding scale and a notched sight gate set at 50, 100 and 150 metres respectively; the BIZON-3 has a rotating flip-up sight gate with height and windage adjustment; both rear sights have lug guards; the BIZON-2 has an AKS-74 stock that folds to the left, while the BIZON-3 has an upward-folding stock that is secured to the top of the receiver by a spring-loaded catch. Both the BIZON-2 and BIZON-3 have several different muzzle devices.',4),('PU',2,'The chain case is inserted directly into the magazine slot of the machine gun like an ordinary magazine, and there is a linkage rod on the right side of the case, which is connected to the pull handle of the machine gun, when the machine moves back and forth, the chain inside the case is \"squeezed\" upwards by the linkage rod, and at the same time, the chain release mechanism inside the case will The cartridge is then pushed into the chamber by the recoil mechanism and the chain is discharged through the opening on the right side of the magazine. So the PU prototype is in fact a magazine fed machine gun based on the RPK-74, except that the designers have provided a chain box that automatically de-chains and feeds the cartridge. However, in view of the complexity of the construction and the potential reliability issues associated with longer duration firing, the design did not use the magazine directly on the RPK-74, but rather modified the machine gun specifically for this purpose. ',2),('RMB-93',2,'The gun operates on both sides. The trigger travel is long and stiff, severely compromising accuracy. The combat version of the RMB-93 has a polymer forend and pistol-shaped grip, and a steel stock that folds forward over the top of the cartridge. The civilian/hunting version of the RMO-93 can be fitted with a similar top-folding metal or wooden stock and semi-pistol grip. The combat version is chambered in 76mm and has a barrel length of 528mm.',6),('RPG-27 disposable rocket launcher',2,'The RPG-27 Tavolga is an expanded version of the RPG-26, which was developed at the same time and is a sister to the RPG-27, which fires 105mm rockets. The construction principle is essentially the same, except for the size difference, the RPG-27 has a 105mm tandem armour-breaking combat section, which breaks armour to a depth of 750mm and can be used against heavily armoured vehicles or those fitted with reactive armour. ',7),('RPK-74 / RPKS-74',2,'The RPK-74 has a long 45-round magazine, but this is fully compatible with the original 30-round magazine, so the RPK-74 can also be used with the rifle\'s 30-round magazine, and the head of the terrorist group al-Qaeda, Bin Laden, is often seen in public photographs and video footage with an AKS-74U fitted with a 45-round magazine. Kalashnikov also designed a 75-round drum, but no RPK-74s have been seen with this type of drum.',2),('RPL-20',2,'The RPL-20 light machine gun differs from previous 5.45mm light machine guns produced by the Kalashnikov Group in that it is open-bore and fully automatic only, although it still has the long-stroke gas-guided piston principle and the traditional Kalashnikov rotary mechanism. However, the gun is not a downsized PKM, but a completely new design, with the gas guide located above the barrel rather than below it. The soft carry pouch hangs under the receiver and holds 100 rounds of 5.45mm non-dispersible chain, and according to the staff at the exhibition, 200 and 250 round capacity cases will be designed in the future. Like the PKM, the gun\'s chain is fed from the right side of the magazine and the cartridge is thrown out on the left side of the magazine. The RPL-20 does not, however, have an upward opening receiver cover like the PKM or the Kord-5.54 (although the Kord-5.54 also has an over-barrel air guide).',2),('SAIGA-410',2,'The Saiga-410 is available in hunting versions with long barrels and fixed stocks (wood or polymer) with semi-pistol shaped grips, and in defensive/tactical versions with AK-74M style grips and side folding polymer stocks and long barrels in the Saiga-410S. There are also models with short barrels and folding stocks such as the Saiga-410K and various other models with short barrels such as the Saiga-410K-01, K-02 and so on.',6),('TASCO 7ET3 Anti-Material Rifle',1,'The 7ET3 anti-material rifle was developed by the Ukrainian state company TASCO (Таско) and is a design reference to the Russian OSV-96, but does not appear to have a folding function.',1),('TASCO 7ET9 / 7ET10 submachine gun',1,'The 7ET9 is a simpler design, removing all those articulated receiver systems, air-cooled systems, and adopting a traditional design that includes a simple free recoil receiver, and an open chamber ready to fire. The receiver is made of stamped steel and the pull handle, similar to that of the Polish PM98, is a slide located on either side of the receiver. The stock folds over the receiver and the foregrip folds back. It can also be replaced with an integral tactical light or laser pointer. ',4),('V-94/OSV-96',2,'The V-94 appears to be very slender, with a rectangular double-chambered muzzle device with sound dampening, flame suppression and retardation, and a guided-air automatic principle, but the operation of the locking mechanism is not known, but it is estimated that it would be of the rotary type with a rate of fire of about 15-20 rounds per minute. The buttstock base plate is cushioned to mitigate the effects of recoil on the shooter when firing. ',3),('Vepr assault rifle',1,'The Vepr (\"wild boar\" in Ukrainian) is a new design of assault rifle announced by Ukraine in 2003. Since the collapse of the Soviet Union, Ukraine has been independent, but its armed forces still use Soviet-era light weapons, including the AKM and AK-74 assault rifles. According to Ukrainian propaganda, the Wild Boar assault rifle is a significant improvement on the AK-74, with much improved combat performance, but in fact it is simply a stockless version of the AK-74. ',1);
UNLOCK TABLES;

